('announcements_feed','announcements','a:23:{i:0;a:7:{s:2:\"id\";s:7:\"3570022\";s:5:\"title\";s:80:\"Drupal CMS 2.0 is here: Visual building, AI, and site templates transform Drupal\";s:12:\"content_html\";s:568:\"<p><img alt=\"\" height=\"400\" src=\"/files/Drupal%20CMS%202.0%20WebHeader.png\" width=\"1200\" /></p>\n<p><strong>January 28, 2026</strong> Today marks one of the biggest evolutions in Drupal\'s 25-year history.</p>\n<p>Drupal CMS 2.0 launches with Drupal Canvas, AI-powered tools, and introduces a component system along with the first site template that enables marketing teams to launch fully branded, professional websites in days instead of weeks. Built on Drupal core, it maintains the enterprise-grade security, scalability, and flexibility Drupal is known for.</p>\";s:3:\"url\";s:104:\"https://www.drupal.org/blog/drupal-cms-20-is-here-visual-building-ai-and-site-templates-transform-drupal\";s:13:\"date_modified\";s:25:\"2026-01-28T21:04:36+00:00\";s:14:\"date_published\";s:25:\"2026-01-28T03:13:51+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:1;a:7:{s:2:\"id\";s:7:\"3567691\";s:5:\"title\";s:21:\"Drupal Turns 25 Today\";s:12:\"content_html\";s:594:\"<p>Twenty-five years! In the world of technology, hitting a quarter-century milestone while remaining a top-notch powerhouse of the internet is an achievement so rare it\'s almost unheard of. Today, we\'re popping the confetti and cutting the cakes around the world to celebrate a colossal journey. This isn\'t just a birthday for a piece of software; it\'s a testament to resilience, constant evolution, and the deep-seated belief in doing things the right way. Join us as we look back on 25 years of shared passion, contribution, and the incredible community that has made Drupal so powerful.</p>\";s:3:\"url\";s:69:\"https://www.drupal.org/about/announcements/blog/drupal-turns-25-today\";s:13:\"date_modified\";s:25:\"2026-01-27T08:54:42+00:00\";s:14:\"date_published\";s:25:\"2026-01-15T12:05:33+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:2;a:7:{s:2:\"id\";s:7:\"3566490\";s:5:\"title\";s:63:\"Get ready to celebrate Drupal\'s 25th birthday on Jan 15th, 2026\";s:12:\"content_html\";s:414:\"<p><a href=\"https://buff.ly/24y5oL8\">https://buff.ly/24y5oL8</a>Drupal turns 25 on 15 January 2026!  Thats 25 years of open source, collaboration, innovation, and an incredible global community.</p>\n<p>Were planning a few ways to celebrate Drupals birthday week (Jan 8-15). Meanwhile, you can start dreaming up your own ways to join the fun  meetups, posts, stories, creativity, and more. </p>\n\";s:3:\"url\";s:109:\"https://www.drupal.org/about/announcements/blog/get-ready-to-celebrate-drupals-25th-birthday-on-jan-15th-2026\";s:13:\"date_modified\";s:25:\"2026-01-15T08:53:28+00:00\";s:14:\"date_published\";s:25:\"2026-01-08T19:58:58+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:3;a:7:{s:2:\"id\";s:7:\"3563660\";s:5:\"title\";s:30:\"Drupal 11.3.0 is now available\";s:12:\"content_html\";s:508:\"<p>The <a href=\"https://www.drupal.org/project/drupal/releases/11.3.0\" rel=\"nofollow\">third feature release of Drupal 11</a> is here with the biggest performance boost in a decade. Serve 26-33% more requests with the same database load. New native HTMX support enables rich UX with up to 71% less JavaScript. Plus, enjoy the new stable Navigation module, improved CKEditor content editing, native content export, and cleaner OOP hooks for themes.</p>\n<p><img alt=\"\" src=\"/files/Drupal113Available.png\" /></p>\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-11-3-0\";s:13:\"date_modified\";s:25:\"2025-12-18T15:15:07+00:00\";s:14:\"date_published\";s:25:\"2025-12-17T12:04:38+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:4;a:7:{s:2:\"id\";s:7:\"3561543\";s:5:\"title\";s:71:\"Drupal Canvas is Now Available: Inside Drupal\'s New Visual Page Builder\";s:12:\"content_html\";s:451:\"<p><img alt=\"\" height=\"428\" src=\"/files/Canvas%20graphic.png\" width=\"816\" /></p>\n<p>For years, Drupal has been the platform of choice for organizations that need serious digital capabilitiesthink universities managing millions of pages, government agencies with complex workflows, and Fortune 500 companies running mission-critical websites. The power is undeniable, but there\'s always been a catch: you needed technical expertise to unlock it.</p>\";s:3:\"url\";s:97:\"https://www.drupal.org/blog/drupal-canvas-is-now-available-inside-drupals-new-visual-page-builder\";s:13:\"date_modified\";s:25:\"2025-12-18T10:41:24+00:00\";s:14:\"date_published\";s:25:\"2025-12-04T18:24:05+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:5;a:7:{s:2:\"id\";s:7:\"3548048\";s:5:\"title\";s:54:\"DrupalCon Chicago 2026: Your Stage to Shape the Future\";s:12:\"content_html\";s:270:\"<p id=\"docs-internal-guid-a810d194-7fff-97e4-cc43-6d2b9095cdb4\"><em>March 2326, 2026 | Chicago, IL</em></p>\n<p>Chicago isn\'t just hosting DrupalCon 2026it\'s providing the stage where the Drupal community writes its next chapter. And that story starts with you.</p>\";s:3:\"url\";s:101:\"https://www.drupal.org/about/announcements/blog/drupalcon-chicago-2026-your-stage-to-shape-the-future\";s:13:\"date_modified\";s:25:\"2025-09-22T20:30:38+00:00\";s:14:\"date_published\";s:25:\"2025-09-22T20:30:38+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:6;a:7:{s:2:\"id\";s:7:\"3546850\";s:5:\"title\";s:76:\"DrupalCon Nara 2025: Building Tomorrow in One of Japan\'s Most Ancient Cities\";s:12:\"content_html\";s:389:\"<p id=\"docs-internal-guid-cfdebe19-7fff-3b3b-ba27-bc768674ee8c\"><em>November 1719, 2025 | Nara, Japan</em></p>\n<p>The energy is building in Asia. Following July\'s groundbreaking first-ever Contribution Day in Tokyowhere developers, translators, and UX experts came together to push Drupal forwardthat momentum is heading straight to one of Japan\'s most culturally rich cities.</p>\";s:3:\"url\";s:122:\"https://www.drupal.org/about/announcements/blog/drupalcon-nara-2025-building-tomorrow-in-one-of-japans-most-ancient-cities\";s:13:\"date_modified\";s:25:\"2025-09-15T21:58:39+00:00\";s:14:\"date_published\";s:25:\"2025-09-15T21:58:39+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:7;a:7:{s:2:\"id\";s:7:\"3545545\";s:5:\"title\";s:93:\"DrupalCon Vienna 2025: Where Digital Ambitions Meet Community Innovation - Will you be there?\";s:12:\"content_html\";s:363:\"<p id=\"docs-internal-guid-76ec9440-7fff-0ce8-e907-506bc36a1f27\"><em id=\"docs-internal-guid-ab650729-7fff-376e-b6bd-e2a6b4a06c58\">October 1417, 2025 | Austria Center Vienna</em></p>\n<p>Vienna is calling the global Drupal community home this October, and we can\'t wait to see what happens when ambitious minds gather in one of Europe\'s most inspiring cities.</p>\";s:3:\"url\";s:137:\"https://www.drupal.org/about/announcements/blog/drupalcon-vienna-2025-where-digital-ambitions-meet-community-innovation-will-you-be-there\";s:13:\"date_modified\";s:25:\"2025-09-08T20:20:15+00:00\";s:14:\"date_published\";s:25:\"2025-09-08T20:19:27+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:8;a:7:{s:2:\"id\";s:7:\"3530875\";s:5:\"title\";s:30:\"Drupal 11.2.0 is now available\";s:12:\"content_html\";s:324:\"<p>The <a href=\"https://www.drupal.org/project/drupal/releases/11.2.0\">second feature release of Drupal 11</a> improves backend and frontend performance and scalability, completes the introduction of OOP support of hooks, adds JSON Schema support, includes AVIF image format capability, supports SDC variants, and more.</p>\n\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-11-2-0\";s:13:\"date_modified\";s:25:\"2025-07-17T01:20:03+00:00\";s:14:\"date_published\";s:25:\"2025-06-19T05:05:25+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:1:\"*\";}}i:9;a:7:{s:2:\"id\";s:7:\"3516956\";s:5:\"title\";s:41:\"State of Drupal presentation (March 2025)\";s:12:\"content_html\";s:459:\"<p>Three months ago,<a href=\"https://dri.es/drupal-cms-1-released\">we launched Drupal CMS 1.0</a>, our biggest step forward in years. Our goal is ambitious: to<a href=\"https://dri.es/introducing-drupal-starshot-product-strategy\">reimagine Drupal</a>as both radically easier to use and a platform for faster innovation.</p>\n<p>In Dries\' DrupalCon Atlanta keynote last week, he reflected on the journey so far, but mostly talked about the work ahead.</p>\n\";s:3:\"url\";s:87:\"https://www.drupal.org/about/announcements/blog/state-of-drupal-presentation-march-2025\";s:13:\"date_modified\";s:25:\"2025-04-07T17:05:05+00:00\";s:14:\"date_published\";s:25:\"2025-04-02T18:27:47+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:10;a:7:{s:2:\"id\";s:7:\"3509234\";s:5:\"title\";s:48:\"DrupalCon Atlanta is almost here! 24-27 of March\";s:12:\"content_html\";s:444:\"<p>DrupalCon is an exciting and invaluable event for anyone involved in the Drupal community, whether youre a developer, website owner, or digital professional. If youre heading to<a href=\"https://events.drupal.org/atlanta2025\" rel=\"nofollow\">DrupalCon Atlanta 2025</a>for the first time, youre in for a treat! Here\'s everything you need to know to make the most of your experience, along with some top tips for how to prepare.</p>\";s:3:\"url\";s:95:\"https://www.drupal.org/about/announcements/blog/drupalcon-atlanta-is-almost-here-24-27-of-march\";s:13:\"date_modified\";s:25:\"2025-02-26T20:33:54+00:00\";s:14:\"date_published\";s:25:\"2025-02-26T20:33:27+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:3:\">=7\";}}i:11;a:7:{s:2:\"id\";s:7:\"3499892\";s:5:\"title\";s:32:\"Drupal CMS 1.0 is now available!\";s:12:\"content_html\";s:436:\"<p>Were excited to share that Drupal CMS 1.0 has officially launched! This new platform is designed to make it easier than ever for marketers and content teams to create amazing digital experiences, all while staying true to Drupals open-source roots.</p>\n<p><img alt=\"Getting started takes minutes\" height=\"720\" src=\"/files/CMS1-1_1.png\" width=\"1280\" /></p>\n<p>Drupal CMS 1.0 is packed with features to make your life easier:</p>\";s:3:\"url\";s:42:\"https://www.drupal.org/blog/drupal-cms-1-0\";s:13:\"date_modified\";s:25:\"2025-01-15T18:40:24+00:00\";s:14:\"date_published\";s:25:\"2025-01-15T17:00:28+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:2:\">7\";}}i:13;a:7:{s:2:\"id\";s:7:\"3494304\";s:5:\"title\";s:30:\"Drupal 11.1.0 is now available\";s:12:\"content_html\";s:263:\"<p>The <a href=\"https://www.drupal.org/project/drupal/releases/11.1.0\" rel=\"nofollow\">first feature release of Drupal 11</a>improves the recipe system, introduces support for hooks written as classes, makes Workspaces more flexible and enhances performance.</p>\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-11-1-0\";s:13:\"date_modified\";s:25:\"2024-12-16T20:28:53+00:00\";s:14:\"date_published\";s:25:\"2024-12-16T17:50:29+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:15;a:7:{s:2:\"id\";s:7:\"3480615\";s:5:\"title\";s:58:\"DrupalCon Singapore 2024: What Awaits You in the Lion City\";s:12:\"content_html\";s:528:\"<p>Its time to dust off those suitcases and start thinking about where your passport is - <a href=\"https://events.drupal.org/singapore2024\" rel=\"nofollow\">DrupalCon Singapore 2024</a> is just around the corner, and this years event promises to be amazing! From 9-11 December, our much-anticipated event will bring together the brightest minds and most passionate contributors from the Drupal community for three days of innovation, learning, and inspiration at the luxurious Parkroyal Collection Marina Bay, Singapore.</p>\";s:3:\"url\";s:105:\"https://www.drupal.org/about/announcements/blog/drupalcon-singapore-2024-what-awaits-you-in-the-lion-city\";s:13:\"date_modified\";s:25:\"2024-10-14T16:49:44+00:00\";s:14:\"date_published\";s:25:\"2024-10-14T16:49:44+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:16;a:7:{s:2:\"id\";s:7:\"3465580\";s:5:\"title\";s:18:\"Drupal 11 released\";s:12:\"content_html\";s:114:\"<p>Today is a big day for<a href=\"https://www.drupal.org/\">Drupal</a>as we officially released Drupal 11!</p>\n\";s:3:\"url\";s:46:\"https://www.drupal.org/blog/drupal-11-released\";s:13:\"date_modified\";s:25:\"2024-08-15T15:10:39+00:00\";s:14:\"date_published\";s:25:\"2024-08-01T22:57:58+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:1:\"*\";}}i:17;a:7:{s:2:\"id\";s:7:\"3456034\";s:5:\"title\";s:28:\"Drupal 10.3 is now available\";s:12:\"content_html\";s:370:\"<p>The <a href=\"https://www.drupal.org/project/drupal/releases/10.3.0\" rel=\"nofollow\">third and final feature release of Drupal 10</a> ships with a new experimental Navigation user interface, stable Workspaces functionality, stable Single-Directory Components support, simplified menu editing, taxonomy moderation support, new recipe and access policy APIs and more.</p>\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-10-3-0\";s:13:\"date_modified\";s:25:\"2024-09-05T23:00:47+00:00\";s:14:\"date_published\";s:25:\"2024-06-20T20:00:04+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:19;a:7:{s:2:\"id\";s:7:\"3427138\";s:5:\"title\";s:52:\"You\'re invited to DrupalCon Portland | 6-9 May, 2024\";s:12:\"content_html\";s:384:\"<p>DrupalCon is an event for developers, marketers/content editors, site owners, and the Drupal-curious to join with the community. You\'ll find incredible keynotes, session content from expert speakers who have helped to build Drupal, networking opportunities with your peers, fun social events, and the chance to deepen your connection by contributing to the open source project.</p>\";s:3:\"url\";s:96:\"https://www.drupal.org/about/announcements/blog/youre-invited-to-drupalcon-portland-6-9-may-2024\";s:13:\"date_modified\";s:25:\"2024-03-18T19:40:04+00:00\";s:14:\"date_published\";s:25:\"2024-03-11T16:49:53+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:20;a:7:{s:2:\"id\";s:7:\"3408836\";s:5:\"title\";s:28:\"Drupal 10.2 is now available\";s:12:\"content_html\";s:378:\"<p>The <a href=\"https://www.drupal.org/project/drupal/releases/10.2.0\">second feature release of Drupal 10</a> improves content modeling, block management, menu and taxonomy organization, and permission administration. New options to sanitize file names make it possible to clean up the names of uploaded files, and media item revisions now have a dedicated user interface.</p>\n\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-10-2-0\";s:13:\"date_modified\";s:25:\"2024-01-25T18:24:28+00:00\";s:14:\"date_published\";s:25:\"2023-12-15T18:27:47+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:21;a:7:{s:2:\"id\";s:7:\"3403229\";s:5:\"title\";s:75:\"Drupal 10 will be supported until the release of Drupal 12 in mid-late 2026\";s:12:\"content_html\";s:190:\"<p>Announcing a new major release schedule with long term support for Drupal 10 until mid-late 2026. Drupal 11 will be released in 2024 and work on the dedicated branch starts this week.</p>\";s:3:\"url\";s:103:\"https://www.drupal.org/blog/drupal-10-will-be-supported-until-the-release-of-drupal-12-in-mid-late-2026\";s:13:\"date_modified\";s:25:\"2024-01-25T18:31:05+00:00\";s:14:\"date_published\";s:25:\"2023-11-22T07:13:55+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:23;a:7:{s:2:\"id\";s:7:\"3368367\";s:5:\"title\";s:28:\"Drupal 10.1 is now available\";s:12:\"content_html\";s:257:\"<p>This first feature release of Drupal 10 is packed with amazing improvements! It makes customizing the look of your site easier, adds support for decoupled navigation, improves content modeling and editing, block management, performance and many more.</p>\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-10-1-0\";s:13:\"date_modified\";s:25:\"2023-10-30T16:22:24+00:00\";s:14:\"date_published\";s:25:\"2023-06-22T09:11:30+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:24;a:7:{s:2:\"id\";s:7:\"3347976\";s:5:\"title\";s:37:\"Contribute to Drupal and the Open Web\";s:12:\"content_html\";s:146:\"<p>Drupal is an open source project. But what does that mean? How can you as a site-owner participate in the project of building a better web?</p>\";s:3:\"url\";s:85:\"https://www.drupal.org/about/announcements/blog/contribute-to-drupal-and-the-open-web\";s:13:\"date_modified\";s:25:\"2023-03-14T19:43:12+00:00\";s:14:\"date_published\";s:25:\"2023-03-14T19:39:44+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:25;a:7:{s:2:\"id\";s:7:\"3343486\";s:5:\"title\";s:43:\"What to expect from the Announcements feed?\";s:12:\"content_html\";s:197:\"<p>Drupal is introducing a new project Announcements feature so that you can see news and updates about the Drupal project and community directly in your Drupal dashboard. Learn what to expect.</p>\";s:3:\"url\";s:90:\"https://www.drupal.org/about/announcements/blog/what-to-expect-from-the-announcements-feed\";s:13:\"date_modified\";s:25:\"2023-02-21T19:45:53+00:00\";s:14:\"date_published\";s:25:\"2023-02-21T19:45:53+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}i:26;a:7:{s:2:\"id\";s:7:\"3327047\";s:5:\"title\";s:26:\"Drupal 10.0.0 is available\";s:12:\"content_html\";s:296:\"<p>Thanks to 2129 contributors from 616 organizations resolving 4083 issues in the past two and a half years, Drupal 10.0.0 is available today! This new version sets Drupal up for continued stability and security for the longer term. All new features will be added to Drupal 10 going forward.</p>\";s:3:\"url\";s:41:\"https://www.drupal.org/blog/drupal-10-0-0\";s:13:\"date_modified\";s:25:\"2023-10-30T16:21:38+00:00\";s:14:\"date_published\";s:25:\"2022-12-15T17:43:23+00:00\";s:10:\"_drupalorg\";a:2:{s:8:\"featured\";b:0;s:7:\"version\";s:5:\">=7.0\";}}}',1771520636),
