INSERT INTO `search_dataset` VALUES
(1,'en','help_search',' viewing drupal announcements what are drupal announcements  a feed of announcements about the drupal project and drupal association programs the purpose of this feed is to provide a channel for outreach directly to drupal site owners this content must be highly relevant to site owners interests serve the strategic goals of the project and or promote the sustainability of the project and the drupal association the module sources its content from a json feed generated from here  the governance policy for the content is documented here  how can i see the announcements in my site  if you have the toolbar module enabled you will see a direct link to them in the toolbar if the toolbar module is not enabled the content can always be accessed in the announcements page who can see the announcements  users with the view official announcements related to drupal permission can view drupal announcements additional resources announcement module overview ',0),
(2,'en','help_search',' configuring a previouslyplaced block goal configure the settings of a block that was previously placed in a region of a theme steps in the manage administrative menu navigate to structure   block layout  click the name of the theme that contains the block optionally click demonstrate block regions to see the regions of the theme if you only want to change the region where a block is located or the ordering of blocks within a region drag blocks to their desired positions and click save blocks  if you want to change additional settings find the region where the block you want to update is currently located and click configure in the line of the block description edit the block s settings the available settings vary depending on the module that provides the block but for all blocks you can change  block title  the heading for the block on your site for some blocks you will need to check the override title checkbox in order to enter a title display title  check the box if you want the title displayed visibility  add conditions for when the block should be displayed region  change the theme region the block is displayed in click save block   ',0),
(3,'en','help_search',' managing blocks what are blocks  blocks are boxes of content rendered into an area or region of a web page of your site blocks are placed and configured specifically for each theme what are content blocks  content blocks are blocks whose content you can edit you can define one or more block types  and attach fields to each block type content blocks can be placed just like blocks provided by other modules what is the block description  the block description is an identification name for a block which is shown in the administrative interface it is not displayed on the site what is the block title  the block title is the heading that is optionally shown to site visitors when the block is placed in a region overview for managing blocks the block module allows you to place blocks in regions of your installed themes and configure block settings the block content module allows you to manage block types and content blocks see the related topics listed below for specific tasks additional resources blocks drupal user guide  ',0),
(4,'en','help_search',' placing a block goal place a block into a theme s region steps in the manage administrative menu navigate to structure  block layout click the name of the theme that you want to place the block in optionally click demonstrate block regions to see the regions of the theme find the region where you want the block and click place block in that region a modal dialog will pop up find the block you want to place and click place block  a configure block modal dialog will pop up configure the block and click save block  see configuring a previouslyplaced block for configuration details  ',0),
(5,'en','help_search',' creating a content block goal create a content block which can later be placed on the site steps in the manage administrative menu navigate to content  open the content blocks tab click add content block  if you have more than one block type defined on your site click the name of the type you want to create enter a description of your block to be shown to administrators and the body text for your block click save   ',0),
(5,'en','node_search',' fresh beef broccoli fresh beef broccoli anonymous not verified mon 16 feb 2026 1415 80 lean beef 10 bone 10 liver steamed broccoli mix ingredients cold serve immediately 137  ',0),
(6,'en','help_search',' defining a block type goal define a block type and its fields steps in the manage administrative menu navigate to structure   block types  click add block type  enter a label for this block type shown in the administrative interface optionally edit the automaticallygenerated machine name or the description click save  you will be returned to the block types page click manage fields in the row of your new block type and add the desired fields to your block type optionally click manage form display or manage display to change the editing form or field display for your block type  ',0),
(6,'en','node_search',' highprotein turkey mix highprotein turkey mix anonymous not verified mon 16 feb 2026 1415 ground turkey spinach sweet potato salmon oil lightly steam the spinach and turkey before mixing 220  ',0),
(7,'en','help_search',' managing height width and resolution breakpoints what are breakpoints  breakpoints are the point at which your site s content will respond to provide the user with the best possible layout to consume the information a breakpoint separates the height or width of viewports screens printers and other media output types into steps for instance a width breakpoint of 40em creates two steps one for widths up to 40em and one for widths above 40em breakpoints can be used to define when layouts should shift from one form to another when images should be resized and other changes that need to respond to changes in viewport height or width what are media queries  media queries are a formal way to encode breakpoints for instance a width breakpoint at 40em would be written as the media query minwidth 40em breakpoints are really just media queries with some additional metadata such as a name and multiplier information what are resolution multipliers  resolution multipliers are a measure of the viewport s device resolution defined to be the ratio between the physical pixel size of the active device and the deviceindependent pixel size the breakpoint module defines multipliers of 1 15 and 2 when defining breakpoints modules and themes can define which multipliers apply to each breakpoint what is a breakpoint group  breakpoints can be organized into groups modules and themes should use groups to separate out breakpoints that are meant to be used for different purposes such as breakpoints for layouts or breakpoints for image sizing managing breakpoints and breakpoint groups overview the breakpoint module allows you to define breakpoints and breakpoint groups in yaml files modules and themes can use the api provided by the breakpoint module to define breakpoints and breakpoint groups and to assign resolution multipliers to breakpoints additional resources working with breakpoints in drupal w3c standards for media queries ',0),
