(9,'en','help_search',' exporting a single configuration item goal export a single configuration item to a file see managing and deploying configuration for more information about configuration steps in the manage administrative menu navigate to configuration   development   configuration synchronization   export   single item  select the configuration type that you want to export and then select the specific configuration name to export use your browser to copy the text in the box marked here is your configuration to the clipboard paste the copied text into a plaintext editor on your computer or other device and save it using the suggested file name below the text box  ',0),
(9,'en','node_search',' chefpaws home page chefpaws home page chefpaws tue 17 feb 2026 1223 title nutrition as unique as they are subtitle stop guessing get vetgrade meal portions calculated specifically for your dog s weight and activity level media feature items headline scientifically portioned description we don t guess our gobased algorithm calculates exact caloric needs based on the dog s weight age and activity level to prevent overfeeding headline butchertobowl quality description we use the same cuts of beef and poultry you d find at a highend market no meal no byproducts and zero fillers just real food headline freshly prepped locally description from our kitchen to your doorstep we leverage local sourcing to ensure your dog is eating fresh neverfrozen raw meals delivered on a schedule that fits your life headline ancestral nutrition description a raw diet supports better digestion shinier coats and smaller stools by mimicking the natural diet dogs were evolved to eat features title uncompromising nutrition  ',0),
(10,'en','help_search',' importing your complete site configuration goal import the complete configuration of your site from an archive file such as one that was previously exported see exporting your complete site configuration see managing and deploying configuration for more information about configuration steps in the manage administrative menu navigate to configuration   development   configuration synchronization   import  browse to find the configuration archive that you want to import click upload  your configuration archive will be unpacked and placed in the configuration synchronization directory and you will be redirected to the synchronize page review the differences between your uploaded configuration and the active configuration if any and click import all to import the changes  ',0),
(11,'en','help_search',' importing a single configuration item goal import a single configuration item in yaml format such as one that was previously exported see exporting a single configuration item see managing and deploying configuration for more information about configuration steps in the manage administrative menu navigate to configuration   development   configuration synchronization   import   single item  select the configuration type that you want to import on your computer or other device copy the yamlformat configuration that you want to import to the clipboard paste the clipboard text into the box labeled paste your configuration here  click import   ',0),
(12,'en','help_search',' connecting text editors to text formats goal configure a text format so that when a user is editing text and selects this text format a text editor installed on your site is shown configure the text editor such as choosing which buttons and functions are available see managing text filters and text formats for more about text formats what is a text editor  a text editor is software typically a javascript library that provides buttons and other command mechanisms to make editing html text easier some editors are called visual or wysiwyg what you see is what you get  editors these editors hide the details of html from the user and instead show formatted output on the screen the core text editor module provides a framework for deploying text editors on your site the core ckeditor 5 module provides ckeditor 5 which is a widelyused javascript text editor that creates clean and valid html the module also enforces the html tag restrictions in the associated text format various contributed modules provide other editors to install a new editor besides installing the module you may need to download the editor library from a thirdparty site steps in the manage administrative menu navigate to configuration   content authoring   text formats and editors  the text editor column in the table shows the text editor that is currently connected to each text format if any follow the steps on managing text filters and text formats to add a new text format or configure an existing text format when you reach the step about text editors return to this topic select ckeditor 5 as the text editor  or another text editor that you have installed the rest of these steps assume you selected ckeditor 5  under toolbar configuration  drag buttons between available buttons and active toolbar  only buttons in active toolbar will be shown to the user focusing or hovering over a button will display a tooltip explaining what the button does drag buttons within active toolbar to the desired order and group buttons by dragging them between group identifiers drag a new group identifier to the toolbar to add additional groups if you add buttons that require configuration the ckeditor 5 plugin settings section will be visible and provide their respective configuration forms return to managing text filters and text formats to complete the text format configuration and be sure to save the text format  ',0),
(13,'en','help_search',' managing text filters and text formats goal configure text formats on the site what are text filters and text formats  a text filter is a processing step that can be applied to text either to transform it in some way such as converting urls in the text into html links or to defend against potentiallydangerous input from site users a text format is an ordered sequence of text filters text filters are provided by modules text formats are managed by the core filter module text fields that have formatted in the field type name such as text formatted   use text formats users choose the text format when editing the field text when the field text is shown on the site it is processed by the chosen text format administrators can configure text formats and assign permissions for who can use each format if the core text editor module is enabled administrators can also associate visual editors with text formats what text filters are available  some of the more commonly used text filters are limit allowed html tags and correct faulty html limits which html tags can be used useful both for site security and enforcing site design convert line breaks into html line breaks in html source are displayed as horizontal spaces this filter converts line breaks into html paragraph and line break tags convert urls into links takes plain urls in text and turns them into html links restrict images to this site for text formats that allow html image tags restricts images to urls within this site steps in the manage administrative menu navigate to configuration   content authoring   text formats and editors  if you do not have the core text editor module installed the menu link and page title will instead be text formats  click configure to configure an existing text format or  add text format to create a new text format enter the desired name for the text format check the roles that can use this text format some html tags allow users to embed malicious links or scripts in text to ensure security anonymous and untrusted users should only have access to text formats that restrict them to either plain text or a safe set of html tags improper text format configuration is a security risk if the core text editor module is installed see the related topic to connect a text editor to this text format under enabled filters  check the text filters that you want to use under filter processing order  drag the filters to the correct order choose the order carefully for example if you have a filter that results in a particular html tag being added to the text that should run after a filter that restricts html tags to avoid deleting the new tags the first filter added under filter settings  verify and adjust the settings for each active filter that has configuration options click save configuration  which will return you to the text formats and editors page repeat these steps if you have additional text formats to configure  ',0),
(14,'en','help_search',' changing the appearance of your site what is a theme  a theme is a set of files that define the visual look and feel of your site the core software and modules that run on your site determine which content including html text and other data stored in the database uploaded images and any other asset files is displayed on the pages of your site the theme determines the html markup and css styling that wraps the content several basic themes are supplied with the core software additional contributed themes can be downloaded separately from the download extend page on drupalorg  or you can create your own theme what is a base theme  a base theme is a theme that is not meant to be used directly on a site but instead acts as a scaffolding for building other themes the core stable 9 theme is one example other base themes can be downloaded from the download extend page on drupalorg  what is a layout  a layout is a template that defines where blocks and other pieces of content should be displayed the core layout discovery module allows modules and themes to register layouts and the core layout builder module provides a visual interface for placing fields and blocks in layouts for entity subtypes and individual entity items see managing content structure for more on entities and fields  changing site appearance overview the main way to change the overall appearance of your site is to switch the default theme the core layout builder and layout discovery modules allow you to define layouts for your site s content and the core breakpoint module helps themes change appearance for differentsized devices see the related topics listed below for specific tasks additional resources extending and customizing your site drupal user guide  theming drupal ',0),
(15,'en','help_search',' managing and deploying configuration what is the configuration system  the configuration system provides the ability for administrators to customize the site and to move and synchronize configuration changes between development sites and the live site it does this in 2 ways providing storage for configuration providing a process in which configuration changes can be imported and exported between instances of the same site for example from dev to staging to live  what is configuration data  configuration data describes settings that define how your site behaves or is displayed for example when a site administrator updates settings using an administrative form these settings are stored as configuration data configuration data describes settings as simple as a site name and as complex as a view or image style what kinds of configuration are there  active configuration active configuration is the current working configuration of a site storage of active configuration is defined by the site and resides in the database by default simple configuration a simple configuration item is a group of settings such as the settings for a module or theme each simple configuration item has its own unique structure configuration entities configuration entities are userdefined configuration items grouped by type such as views image styles and content types each configuration entity within a type has a similar structure default configuration default configuration can be defined by a module theme or installation profile in its config install or config optional directories configuration is provided in yaml files file extension yml yaml is a humanreadable data serialization standard that is used by the core software for several purposes once the default configuration has been imported into the site s active configuration through installing the extension that configuration is owned by the site not the extension this means that future updates of the extension will not override the site s active configuration for that extension what is configuration synchronization  configuration synchronization is the process of exporting and importing configuration to keep configuration synchronized between different versions of a site for example between a development site and the live site each site has unique identifier also called a uuid  which identifies the site to the system in any instance of the site as long as the site instances have been reproduced as clones cloning is when the codebase and database are copied to create a new site instance when site instances are cloned a dev instance of the site has the same uuid as the live instance when site instances share the same uuid configuration can be exported from one instance to another the following list contains terms and concepts related to configuration synchronization exported configuration when configuration is exported the active configuration is exported as a set of files in yaml format when using the configuration synchronization administrative ui configuration can be exported as a fullexport or singleitem archive this archive can then be imported into the destination site instance imported configuration imported configuration is configuration that has been exported from another instance of the site the source and is now being imported into another site instance the destination thereby updating its active configuration to match the imported configuration data set configuration sync directory the configuration sync directory location is set in the site s settingsphp file when configuration is exported the active configuration is exported and described in yaml files which are stored in the configuration sync directory after the first export the system compares the site s active configuration with the configuration data in the sync directory and will only export active configuration items that are different than their counterparts in the sync directory managing configuration overview configuration management tasks such as exporting or importing configuration and synchronizing configuration can be done either through the administrative ui provided by the core configuration manager module or a commandline interface cli tool defining a configuration sync directory path other than the default value requires read write access to the site s settingsphp file most modules and themes also provide settings forms for updating the configuration they provide see the related topics listed below for specific tasks additional resources configuration management workflow using drush concept types of data drupal user guide  concept development sites drupal user guide  making a development site drupal user guide  ',0),
(16,'en','help_search',' managing content structure what types of data does a site have  there are four main types of data content is the information text images etc meant to be displayed to website visitors configuration is data that defines how the content is displayed some configuration such as field labels may also be visible to site visitors state is temporary data about the state of your site such as the last time the system cron jobs ran session is a subset of state information related to users interactions with the site such as site cookies and whether or not they are logged in what is a content entity  a content entity  or more commonly  entity  is an item of content data which can consist of text html markup images attached files and other data content entities are grouped into entity types  which have different purposes and are displayed in very different ways on the site most entity types are also divided into entity subtypes  which are divisions within an entity type to allow for smaller variations in how the entities are used and displayed for example the content item entity type that stores pagelevel content is divided into content type subtypes the content block entity type has block types  but the user entity type for user profile information does not have subtypes what is a field  within entity items the data is stored in individual fields  each of which holds one type of data such as formatted or plain text images or other files or dates fields can be added by an administrator on entity subtypes so that all entity items of a given entity subtype have the same collection of fields available and they can be singlevalued or multiplevalued when you create or edit entity items you are specifying the values for the fields on the entity item what is a reference field  a reference field is a field that stores a relationship between an entity and one or more other entities which may belong to the same or different entity type for example a content reference field on a content type stores a relationship between one content item and one or more other content items what field types are available  the following field types are provided by the core system and core modules many more are provided by contributed modules boolean number provided by the core system stores true false values and numbers comment provided by the core comment module allows users to add comments to an entity date timestamp datetime module stores dates and times date range datetime range module stores time date periods with a start and an end email core system stores email addresses link link module stores urls and link text list options module stores values chosen from predefined lists where the values can be numbers or text see section below for more on list fields reference core system stores entity references see section above telephone telephone module stores telephone numbers text text module stores formatted and unformatted text see section below for more on text fields what settings are available for list field types  list fields associate predefined keys  or value codes with labels that the user sees for example you might define a list field that shows the user the names of several locations while behind the scenes a location code is stored in the database each list field type corresponds to one type of stored key for example a list integer  field stores integers while the list text  field stores text strings once you have chosen the field type the main setting for a list field is the allowed values list which associates the keys with the labels what types of text fields are available  there are several types of text fields with different characteristics text fields can be either plain or formatted  plain text fields do not contain html while formatted fields can contain html and are processed through text filters  these are provided by the core filter module if you have that module enabled see the related topic below on filters for more information text fields can also be regularlength with a limit of 255 characters or long  with a very large character limit and long formatted text fields can include a summary attribute all possible combinations of these characteristics exist as text field types for example  text plain  and text formatted long with summary  are two examples of text field types what is a formatter  a formatter is a way to display a field most field types offer several types of formatters and most formatters have settings that further define how the field is displayed it is also possible to completely hide a field from display and you have the option of showing or hiding the field s label when it is displayed what is a widget  a widget is a way to edit a field some field types such as plain text singleline fields have only one widget available in this case a singleline text input field other field types offer choices for the widget for example singlevalued list fields can use a select or radio button widget for editing many widget types have settings that further define how the field can be edited managing content structure overview besides the field modules listed in the previous section there are additional core modules that you can use to manage your content structure the core node comment content block custom menu links user file image media and taxonomy modules all provide content entity types the core field ui module provides a user interface for managing fields and their display on entities the core layout builder module provides a more flexible user interface for configuring the display of entities the core filter responsive image and path modules provide settings and display options for entities and fields depending on the core and contributed modules that you currently have installed on your site the related topics below and other topics listed on the main help page see help will help you with tasks related to content structure additional resources concept types of data drupal user guide  planning your site drupal user guide  concept reference fields drupal user guide  ',0),
(17,'en','help_search',' running and configuring cron goal configure your system so that cron will run automatically what are cron tasks  to ensure that your site and its modules continue to function well a group of administrative operations should be run periodically these operations are called cron tasks and running the tasks is known as running cron  depending on how often content is updated on your site you might need to run cron on a schedule ranging from hourly to weekly to keep your site running well what options are available for running cron  if the core automated cron module is installed your site will run cron periodically on a schedule you can configure you can set up a task on your web server to visit the cron url  which is unique to your site on a schedule you can also run cron manually but this is not the recommended way to make sure it is run periodically steps in the manage administration menu navigate to configuration   system   cron  note the last run time on the page if you want to run cron right now click run cron and wait for cron to finish if you have a way to configure tasks on your web server copy the link where it says to run cron from outside the site go to  set up a task to visit that url on your desired cron schedule such as once an hour or once a week on linuxlike servers you can use the wget command to visit a url if you configure an outside task you should uninstall the automated cron module if you are not configuring an outside task and you have the core automated cron module installed select a schedule for automated cron runs in cron settings   run cron every  click save configuration  additional resources concept cron drupal user guide  configuring cron maintenance tasks drupal user guide  ',0),
(18,'en','help_search',' extending and modifying your site functionality what is a module  a module is a set of php javascript and or css files that extends site features and adds functionality a set of core modules is distributed as part of the core software download additional contributed modules can be downloaded separately from the download extend page on drupalorg  what is an experimental module  an experimental module is a module that is still in development and is not yet stable using experimental modules on production sites is not recommended what are installing and uninstalling  installing a core or downloaded contributed module means turning it on so that you can use its features and functionality uninstalling means turning it off and removing all of its configuration a module cannot be uninstalled if another installed module depends on it or if you have created content on your site using the module you would need to delete the content and uninstall dependent modules first extending overview see the related topics listed below for help performing tasks related to extending the functionality of your site additional resources concept modules drupal user guide  extending and customizing your site drupal user guide  ',0),
(19,'en','help_search',' maintaining and troubleshooting your site maintaining and troubleshooting overview here are some tasks and hints related to maintaining your site and troubleshooting problems that may come up on your site see the related topics below for more information when performing maintenance such as installing uninstalling or updating a module put your site in maintenance mode configure your site so that cron runs periodically if your site is not behaving as expected clear the cache before trying to diagnose the problem there are several site reports that can help you diagnose problems with your site there are also two core modules that can be used for error logging database logging and syslog additional resources preventing and fixing problems drupal user guide  security and maintenance drupal user guide  ',0),
(20,'en','help_search',' managing media what are media items  core media items include audio images documents and videos you can add other media types such as social media posts through the use of contributed modules media items may be files located in your site s file system or remote items referenced by a url media items are content entities and they are divided into media types which are entity subtypes media types can have fields see managing content structure for more information on content entities and fields what is the media library  the media library is a visual user interface for managing and reusing media items add media items to content using media reference fields and the media library field widget what is an image style  an image style is a set of processing steps known as effects  that can be applied to images examples of effects include scaling and cropping images to different sizes responsive image styles can associate image styles with your theme s size breakpoints this allows serving images sized for the browser width overview of managing media the following modules provide mediarelated functionality media items and media types are managed by the core media module the core media module provides a media reference field to add media to content entities the core file and image modules also provide reference fields it is recommended to use the media reference field because it is more versatile the core media library module provides the media library and the media library field widget with this module installed the media library field widget becomes the default widget for editing media reference fields the core image module provides a user interface for defining image styles the core responsive image module provides responsive image styles using the core breakpoint module and a breakpointenabled theme these responsive styles can serve images sized for the browser see the related topics listed below for specific tasks additional resources media module ',0),
(21,'en','help_search',' managing menus what is a menu  a menu is a collection of menu links used to navigate a web site menus and menu links can be provided by modules or site administrators managing menus overview the core menu ui module provides a user interface for managing menus including creating new menus reordering menu links and disabling links provided by modules it also provides the ability for links to content items to be added to menus while editing if configured on the content type the core custom menu links module provides the ability to add custom links to menus each menu can be displayed by placing a block in a theme region some themes also can display a menu outside of the block system see the related topics listed below for specific tasks additional resources concept menu drupal user guide  ',0),
(22,'en','help_search',' optimizing site performance what is site performance  site performance in this context refers to speed factors such as the page load time and the response time after a user action on a page what is caching  caching is saving alreadyrendered html output and other calculated data for later use the first time it is needed this saves time because the next time the same data is needed it can be quickly retrieved instead of recalculated automatic caching systems also include mechanisms to delete cached calculations or mark them as no longer valid when the underlying data changes to facilitate that cached data has a lifetime  which is the maximum time before the data will be deleted from the cache forcing recalculation  what is file aggregation  aggregation is when css and javascript files are merged together and compressed into a format that is much smaller than the original this allows for faster transmission and faster rendering on the other end what can i do to improve my site s performance  the following core software modules and mechanisms can improve your site s performance internal page cache module caches pages requested by users who are not logged in anonymous users do not use if your site needs to send different output to different anonymous users internal dynamic page cache module caches data for both authenticated and anonymous users with noncacheable data in the page converted to placeholders and calculated when the page is requested big pipe module changes the way pages are sent to users so that cacheable parts are sent out first with placeholders and the uncacheable or personalized parts of the page are streamed afterwards this allows the browser to render the bulk of the page quickly and fill in the details later performance page settings in the manage administrative menu if you navigate to configuration   development   performance  you will find a setting for the maximum cache lifetime as well as the ability to turn on css and javascript file aggregation additional resources online documentation for the internal page cache module online documentation for the internal dynamic page cache module online documentation for the bigpipe module ',0),
(23,'en','help_search',' making your site secure what are security updates  any software occasionally has bugs and sometimes these bugs have security implications when security bugs are fixed in the core software modules or themes that your site uses they are released in a security update  you will need to apply security updates in order to keep your site secure what are security advisories  a security advisory is a public announcement about a reported security problem in the core software contributed projects with a shield icon and stable releases for this project are covered by the security advisory policy on their project page are also covered by drupal s security advisory policy security advisories are managed by the drupal security team  security tasks keeping track of updates updating the core software and updating contributed modules and or themes are all part of keeping your site secure see the related topics listed below for specific tasks additional resources security and maintenance drupal user guide  security advisory process and permissions policy ',0),
(24,'en','help_search',' using inline quick settings editing goal edit settings in place what is quick editing  the core settings tray module provides the ability to quickly edit settings inline it requires the core contextual links module in order to expose the links that let you edit in place who can edit settings in place  in order to follow these steps to edit settings in place the core settings tray module must be installed also either the core toolbar module or a contributed replacement must be installed you will need to have use contextual links permission as well as permission to edit the particular content or settings steps find and visit a page on your site that has the settings that you would like to edit click the contextual links edit button on the toolbar in most themes it looks like a pencil contextual edit links with the same icon will appear all over your page find the contextual link for the part of the page you want to edit for example if you want to edit the settings for a block the link should be in the topright corner of the block or topleft for righttoleft languages click the link to open the contextual links menu and click quick edit  an editing form for the settings should appear on the page make your edits and submit the form  ',0),
(25,'en','help_search',' working with languages and translations what text can be translated in your site  there are three types of text that can be translated content blocks content items etc can be written in english or another language and can be translated into additional languages see managing content structure to learn more about content many configuration items also include text that can be translated default configuration provided by your site s software is provided in english you can also download communityprovided translations see managing and deploying configuration to learn more about configuration user interface text that is provided by the core software your install profile themes and modules is provided in english but can be translated into other languages you can also download translations that communitymembers have provided working with languages overview the core language module lets you add new languages to your site provides the language switcher block and provides the ability to configure block visibility by language the block and block visibility settings are only available if you have multiple languages configured the core content translation configuration translation and interface translation modules let you translate content configuration and the builtin user interface respectively the core locale module manages automatic downloads of communityprovided translations of default configuration and userinterface text if the core update status module is installed see the related topics listed below for specific tasks  ',0),
(26,'en','help_search',' accessibility of the administrative interface overview of accessibility the core administrative interface has builtin compliance with many accessibility standards so that most pages are accessible to most users in their default state however certain pages become more accessible to some users through the use of a nondefault or improved interface these interfaces include disabling draganddrop functionality the default draganddrop user interface for ordering tables in the administrative interface presents a challenge for some users including keyboardonly users and users of screen readers and other assistive technology the draganddrop interface can be disabled in a table by clicking a link labeled show row weights above the table the replacement interface allows users to order the table by choosing numerical weights with increasing numbers instead of dragging table rows enabling inline form errors errors that occur when you submit a form such as not filling in a required field are sometimes difficult for users to understand and locate in order to make these errors easier to find the best practice is to put a summary of the errors at the top of the form page to make them easier to understand the best practice is to display error messages with the form fields they are related to both of these practices are implemented by the core inline form errors module  ',0),
(27,'en','help_search',' using the administrative interface what administrative interface components are available  the following administrative interface components are provided by the core software and its modules some contributed modules offer additional functionality accessibility features to enable all users to perform administrative tasks see accessibility of the administrative interface for more information a menu system which you can navigate to find pages for administrative tasks the core toolbar module displays this menu on the top or left side of the page right side in righttoleft languages there are also contributed module replacements for the core toolbar module with additional features such as the admin toolbar module  the core shortcuts module enhances the toolbar with a configurable list of links to commonlyused tasks if you install the core contextual links module nonadministrative pages will contain links leading to related administrative tasks inplace or quick editing inplace editing of configuration is provided by the core settings tray module see using inline quick settings editing for more information the core help module displays help topics and provides a help block that can be placed on administrative pages to provide an overview of their functionality what are the sections of the administrative menu  the administrative menu which you can navigate by visiting  admin on your site or by using an administrative toolbar has the following sections some may not be available depending on which modules are currently installed on your site and your permissions  content  find manage and create new pages manage comments and files structure  place and edit blocks set up content types and fields configure menus administer taxonomy and configure some contributed modules appearance  switch between themes install themes and update existing themes extend  update install and uninstall modules configuration  configure the settings for various site functionality including some contributed modules people  manage user accounts and permissions reports  display information about site security necessary updates and site activity help  get help on using the administrative interface administrative interface overview install the core modules mentioned above to use the corresponding aspect of the administrative interface see the related topics listed below for more details on some aspects of the administrative interface  ',0),
(28,'en','help_search',' enabling web services what is a web service  a web service allows your site to provide its content and data to other web sites and applications typically the data is transported via http in a serialized machinereadable format what is serialization  serialization is the process of converting complex data structures into text strings so that they can be exchanged and stored the reverse process is called deserialization  json and xml are the two mostcommonlyused data serialization formats for web services what is http basic authentication  http basic authentication is a method for authenticating requests by sending a user name and password along with the request what modules provide web services  the following core software modules provide web services json api module exposes entities to other applications using a fully compliant implementation of the json api specification  see managing content structure for more information on content entities and fields restful web services module exposes entities and other resources to other applications using a rest implementation data is exchanged using a serialization format such as json and transferred using an authentication method such as http basic authentication serialization module provides a framework for adding specific serialization formats for other modules to use http basic authentication module provides a way for web services to be authenticated using http basic authentication against site user accounts there are also contributed modules that provide web services additional resources online documentation for the restful web services module online documentation for the json api module comparison of the restful web services and json api modules ',0),
(29,'en','help_search',' configuring help search goal set up your site so that users can search for help steps in the manage administrative menu navigate to extend  verify that the search help and block modules are installed or install them if they are not already installed in the manage administrative menu navigate to configuration   search and metadata   search pages  verify that a help search page is listed in the search pages section if not add a new page of type help  check the indexing status of the help search page if it is not fully indexed see running and configuring cron about how to run cron until indexing is complete in the future you can click rebuild search index on this page or clearing the site cache in order to force help topic text to be reindexed for searching this should be done whenever a module theme language or string translation is updated in the manage administrative menu navigate to structure   block layout  click the link for your administrative theme such as the core claro theme near the top of the page and verify that there is already a search block for help located in the help region if not follow the steps in the related topic to place the search form block in the help region when configuring the block choose help as the search page and in the pages tab under visibility  enter  admin help to make the search form only visible on the main help page in the manage administrative menu navigate to help  verify that the search block is visible and try a search  ',0),
(30,'en','help_search',' working with help topics what is a help topic  a help topic describes a concept or steps to accomplish a task related to a feature provided by one or more modules or themes if the core search module is enabled these topics are also searchable where are help topics listed  the toplevel help topics are listed at help links to other topics including nontoplevel help topics can be found under the related heading when viewing a topic page how are help topics provided  modules and themes can provide help topics as twigfilebased plugins in a project subdirectory called helptopics  plugin metadata is provided in yaml front matter within each twig file pluginbased help topics provided by modules and themes will automatically be updated when a module or theme is updated use the plugins in core modules help helptopics as a guide when writing and formatting a help topic plugin for your theme or module how are help topics translated  the title and body text of help topics provided by contributed modules and themes are translatable using user interface translation provided by interface translation module topics provided by custom modules and themes are also translatable if they have been viewed at least once in a nonenglish language which triggers putting their translatable text into the translation database how can users search for help topics  to enable users to search help including help topics you will need to install the core search module configure a search page and add a search block to the help page or another administrative page a search page is provided automatically and if you use the core claro administrative theme a help search block is shown on the main help page then users with search permissions and permission to view help will be able to search help see the related topic configuring help search for stepbystep instructions additional resources help topics standards ',0),
(31,'en','help_search',' configuring search pages goal configure one or more search pages steps in the manage administrative menu navigate to configuration   search and metadata   search pages  scroll down to the search pages section you will see a list of the alreadyconfigured search pages on your site to configure an existing search page click edit  or to add a new search page select the search page type and click add search page  enter the desired label name and url path for the search page for content search pages select the desired level of influence in ranking search results of the available content ranking factors click save  you will be returned to the search pages page verify that the correct search page is listed as default in the status column if not click set as default in the operations list for the correct search page optionally disable or delete any search pages that you do not want to have available on the site disabling is temporary while deleting is permanent follow the steps in managing the search index to make sure that the search index is updated  ',0),
(32,'en','help_search',' managing the search index goal manage the search index and make sure that the site is fully indexed for searching what is the search index  the content and help search types provided by the core software preindex their content and store the results in several database tables that are collectively called the search index  the process of indexing renders the content and breaks it up into words which can then be matched more efficiently with keyword queries when users perform searches search indexing happens during cron runs see running and configuring cron for more information about cron steps in the manage administrative menu navigate to configuration   search and metadata   search pages  under indexing throttle  select the number of items to index per cron run  a smaller number will make cron faster and reduce the possibility of timeout a larger number will make sure more of your site is indexed in fewer cron runs under default indexing settings  enter the desired minimum word length to index  words smaller than this length will be dropped from both keywords when searching and content when indexing if your site uses chinese japanese or korean languages optionally check simple cjk handling under default indexing settings to provide some support for these languages click save configuration  and you should be returned to the search pages page click reindex site if you have changed the indexing configuration or later on if you believe that the search index has been corrupted follow the steps in running and configuring cron to make sure a cron task has been configured after waiting for cron to run several times verify that the content has been fully indexed for searching the overall status is listed under indexing progress  and the status for each search page is shown in the indexing progress column of the search pages section  ',0),
(33,'en','help_search',' configuring site search what are search pages  the core search module organizes site search into pages  each page allows users to search a particular type of content with a particular configuration the configuration includes specifying a url that starts with search  a name for the page and additional options for some search page types when users visit the main search page see search  they will see the configured search pages that they have access to each search page has a search form on it and the page will display search results after the user enters keywords into the form and clicks the search button what modules provide site search  the core search module provides the ability to configure search pages search page types are provided by both core and contributed modules the core modules that provide search page types are the node module for searching content pages the user module for searching user profiles the help module for searching help topics as an alternative to the core search module s system of search pages you can use contributed modules to provide site search for example the apache solr and sphinx contributed modules use thirdparty technology to provide site search what are the limitations of the core search module  there are two main limitations of the core search module first it is not appropriate for very large sites if you have a large site look into other search technologies like apache solr second the node search page type only supports exact keyword matching which is not the behavior that most users will expect you can improve this by installing a languagespecific stemming module for your language such as porter stemmer for american english which makes it so that for example a search for the word walk would match pages containing the words walk walking and walked what are the search permissions  users with use search permission can use the search form block and search page this permission is required for any search configured in the core search module in addition to use search   view user information permission is needed for searching users in addition to use search   view published content permission is needed for searching content users with use advanced search permission can use more complex search filtering when performing content searches configuring site search overview in order to configure site search using the core search module you will need to configure one or more search pages you will also need to verify or alter permissions so that the desired user roles can search the site see managing user accounts and site visitors for more information about roles and permissions for content search you will also need to make sure that the search index is configured and that the site is fully indexed finally you may wish to place the search form block on pages of your site or add the search page to a navigation menu to give users easy access to search see the related topics listed below for specific tasks additional resources online documentation for the search module ',0),
(34,'en','help_search',' clearing the site cache goal clear the data in the site cache what is the cache  some of the calculations that are done when your site loads a page take a long time to run to save time when these calculations would need to be done again their results can be cached in your site s database there are internal mechanisms to clear cached data when the conditions or assumptions that went into the calculation have changed but you can also clear cached data manually when your site is misbehaving a good first step is to clear the cache and see if the problem goes away steps in the manage administrative menu navigate to configuration   development   performance  click clear all caches  your site s cached data will be cleared additional resources concept cache drupal user guide  ',0),
(35,'en','help_search',' changing basic site settings goal configure the basic settings of your site including the site name slogan main email address default time zone default country and the date formats to use steps in the manage administrative menu navigate to configuration   system   basic site settings  enter the site name slogan and main email address for your site click save configuration  you should see a message indicating that the settings were saved in the manage administrative menu navigate to configuration   region and language   regional settings  select the default country and default time zone for your site click save configuration  you should see a message indicating that the settings were saved in the manage administrative menu navigate to configuration   region and language   date and time formats  look at the patterns for the default long medium and short date formats if any of them does not match the date format you want to use on your site click edit in that row to edit the format adjust the format string until the displayed format matches what you want date format strings are composed of php date format codes click save format  you should see a message indicating that the format was saved repeat the previous three steps for any other date formats that need to be changed additional resources php date format codes reference ',0),
(36,'en','help_search',' configuring error responses including 403404 pages goal set up your site to respond appropriately to site errors including 403 and 404 page responses what are 403 and 404 responses  when a user visits a web page the web server sends a response code in addition to the page content a normal nonerror response has code 200 if the page does not exist on the site the response code is 404 if the page exists but the user is not authorized to visit the page the response code is 403 the core software provides default responses for both 403 and 404 codes but if you prefer you can create your own pages for each what other errors can occur  under some situations your site can generate error messages these can be due to user errors such as entering invalid values in a form or incorrect configuration php runtime errors or software bugs some errors may result in a white screen of death  a totally blank web page response less drastic errors will generate error messages you can configure what happens when an error message is generated steps if desired create pages to use for 403 and 404 responses note the urls for these pages in the manage administrative menu navigate to configuration   system   basic site settings  in the error pages section enter the url for your 403404 pages starting after the site home page url for example if your site url is https examplecom and your 404 page is https examplecom notfound  you would enter  notfound  click save configuration  you should see a message indicating that the settings were saved in the manage administrative menu navigate to configuration   development   logging and errors  for a production site select none under error messages to display  for a site that is in development select one of the other options so that you are more aware of the errors the site is generating click save configuration  you should see a message indicating that the settings were saved  ',0),
(37,'en','help_search',' enabling and disabling maintenance mode goal put your site in maintenance mode to perform maintenance operations and then return to normal mode when finished what is maintenance mode  when your site is in maintenance mode most site visitors will see a simple maintenance mode message page rather than being able to use the full functionality of the site users with use the site in maintenance mode permission who are already logged in will be able to use the full site and the log in page at  user will also be accessible to anyone steps in the manage administrative menu navigate to configuration   development   maintenance mode  check put site into maintenance mode  optionally change the message to display when in maintenance mode  and click save configuration  your site will be in maintenance mode perform your maintenance operations in the manage administrative menu navigate to configuration   development   maintenance mode  uncheck put site into maintenance mode and click save configuration  your site will be back in normal operation mode clear the site cache see clearing the site cache for instructions  ',0),
(38,'en','help_search',' installing a module goal install a core module or a contributed module that has already been downloaded steps in the manage administrative menu navigate to extend  enter a word from the module name or description into the filter box to make the list of modules smaller locate the module you want to install check the box next to the name of the module you want to install you can also check more than one box to install multiple modules at the same time if the checkbox is disabled for the module you are trying to install expand the information to see why you may need to download an additional module that your module requires click install at the bottom of the page if you chose to install a module with dependencies that were not already installed or if you chose an experimental module confirm your choice on the next page wait for the module or modules to be installed you should be returned to the extend page with a message saying the module or modules were installed  ',0),
(39,'en','help_search',' uninstalling a module goal uninstall a module your site should be in maintenance mode when you uninstall modules see enabling and disabling maintenance mode for details steps in the manage administrative menu navigate to extend   uninstall  enter a word from the module name or description into the filter box to make the list of modules smaller locate the module you want to uninstall in the description column see if there are reasons that this module cannot be uninstalled for example you may have created content using this module which you would need to delete first or there may be another module installed that requires this module to be installed you would need to uninstall the other module first if there are no reasons listed the module can be uninstalled check the box in the uninstall column next to the module s name click uninstall at the bottom of the page verify the list of modules to be uninstalled and configuration to be deleted on the confirmation page and click uninstall  wait for the module to be uninstalled you should be returned to the uninstall page with a message saying the module was uninstalled  ',0),
(40,'en','help_search',' running reports on your site goal run reports to learn about the status and health of your site steps in the manage administrative menu navigate to reports   status report to see a report that summarizes the health and status of your site if there are any warnings or errors you will need to fix them take note of any upcoming highly critical security releases that may impact your site if you have the core database logging module installed in the manage administrative menu navigate to reports   recent log messages to see a report of the error and informational messages your site has generated you can filter the report by severity to see only the most critical messages if desired if you have the core update status module installed in the manage administrative menu navigate to reports   available updates to see a report of the updates that are available for your site software if last checked is far in the past click check manually to update the report scan the report if the core software or any modules or themes have security updates available you should update them as soon as possible additional resources security and maintenance drupal user guide   which includes information on how to update your site s core software modules and themes  ',0),
(41,'en','help_search',' installing a theme and setting default themes goal install a core theme or a contributed theme that has already been downloaded choose the default themes to use for the site and for administrative pages steps in the manage administrative menu navigate to appearance  locate the themes that you want to use as the site default theme and for administrative pages for each of these themes if the theme is in the uninstalled themes section click the install link to install the theme wait for the theme to be installed translations might be downloaded you should be returned to the appearance page locate the theme that you want to be your default theme which should now be in the installed themes section if it is not already labeled as the default theme  click the set as default link at the bottom of the page select the administration theme that you want to use on administrative pages click save configuration if you selected a new theme if you changed the default theme for your site visit the site home page or another page on the nonadministration part of your site and verify that the site is using the new theme if you changed the administration theme verify that the new theme is used on administrative pages  ',0),
(42,'en','help_search',' uninstalling an unused theme goal uninstall a theme that was previously installed but is no longer being used on the site steps in the manage administrative menu navigate to appearance  locate the theme that you want to uninstall in the installed themes section click the uninstall link to uninstall the theme if there is not an uninstall link the theme cannot be uninstalled because it is either being used as the site default theme being used as the administration theme  or is the base theme for another installed theme  ',0),
(43,'en','help_search',' creating a user account goal create a new user account steps in the manage administrative menu navigate to people  click add user  enter the email address   username  and password  twice for the new user verify that the roles checked for the new user are correct if you want the new user to receive an email message notifying them of the new account check notify user of new account  optionally change other settings on the form click create new account  you will be left on the add user page repeat these steps if you have more user accounts to create  ',0),
(44,'en','help_search',' adding a new role goal create a new role steps in the manage administrative menu navigate to people   roles  click add role  enter the desired role name  if desired click edit to change the machine name for the role click save  you should be returned to the roles page and your new role should be in the role list  ',0),
(45,'en','help_search',' managing user accounts and site visitors what is a user  a user is anyone accessing or viewing your site anonymous users are users who are not logged in and authenticated users are users who are logged in what is a role  roles are used to group and classify users each user can be assigned one or more roles there are also special roles for all anonymous and all authenticated users what is a permission  granting a permission to a role allows users who have been assigned that role to perform an action on the site such as viewing content editing or creating a particular type of content administering settings for a particular module or using a particular function of the site such as search  overview of managing user accounts and visitors the core user module allows users to register log in and log out and administrators to manage user roles and permissions depending on which modules you have installed on your site the related topics below will help you with tasks related to managing user accounts and visitors  ',0),
(46,'en','help_search',' modifying the permissions for a role goal modify the permissions for an existing role steps in the manage administrative menu navigate to people   permissions  review the permissions for the role paying particular attention to the permissions marked with warning give to trusted roles only this permission has security implications uncheck permissions that this role should not have in the row of the permission and the column of the role check permissions that this role should have click save permissions   ',0),
(47,'en','help_search',' configuring how user accounts are created and deleted goal configure settings related to how user accounts are created and deleted what are the settings related to user account creation and deletion  you can make it possible for new users to register themselves for accounts with or without email verification or administrative approval or you can make it so only administrators with administer users permission can register new users you can configure what happens to content that a user created if their account is canceled  deleted you can edit the email messages that are sent to users when their accounts are pending approved created blocked or canceled or when they request a password reset what are variables in email message text  variables are short text strings enclosed in square brackets that you can insert into configured email message text when an individual message is generated data from your site is substituted for the variables some commonlyused variables are site name the name of your website site url the url of your website site loginurl the url where users can log in to your site user displayname the user s displayed name user accountname the user s account name user mail the user s email alias user onetimeloginurl an expiring url that a user can use to log in once if they need to reset their password steps in the manage administrative menu navigate to configuration   people   account settings  select the method you want to use for creating user accounts and check or uncheck the box that requires email verification to match the settings you want for your site select the desired option for what happens to content that a user created if their account is canceled optionally edit the text of email messages related to user accounts verify that the other settings are correct click save configuration  you should see a message indicating that the settings were saved  ',0),
(48,'en','help_search',' modifying or deleting a user account goal update or delete an existing user account steps in the manage administrative menu navigate to people  enter all or part of the user name or email address of the user account you want to update or delete and click filter  a short list of user accounts including the account of interest should be shown in the table if not modify the filter text until you can find the account of interest click edit in the operations area of the account of interest to delete the user account scroll to the bottom and click cancel account  select what you want to happen to the user s content on the next screen and click cancel account  to update the user account enter new values in the form and click save   ',0),
(49,'en','help_search',' configuring comments goal configure a content entity type subtype to allow commenting using a comment type that you have configured see managing content structure for more about content entities and fields and creating a comment type to configure a comment type who can configure comments  in order to follow these steps the field ui module must be installed you ll need the comment module s administer comments and comment settings permission in order to change comment settings for a comment field you ll also need to have the appropriate permission for adding fields to the entity type or subtype that the comments are attached to for example to add a comment field to content items provided by the node module you would need the node module s administer content types permission steps follow the steps in the related adding a field to an entity subtype topic to add a field of type comments to the desired entity type or subtype on the first field settings page choose the comment type to use for this entity type or subtype you ll also notice that the allowed number of values field cannot be changed for comment fields on the next field settings page enter the desired settings for the comment field  threading  whether or not the comments are collected by threads with people able to reply to particular comments instead of to the content entity itself comments per page  the maximum number of comments displayed on one page a pager will be added if you exceed this limit  anonymous commenting  whether or not anonymous commenters are allowed or required to leave contact information with their comments only applies if anonymous users have permission to post comments  show reply form on the same page as comments  whether the comment reply form is displayed on the same page as the comments if this is not selected clicking reply will open a new page with the reply form preview comments  whether previewing comments before submission is required   optional  or disabled  default value  each individual entity has its own comment settings but here you can set defaults for the comment settings for this entity type or subtype the comment settings values are  open  comments are allowed closed  past comments remain visible but no new comments are allowed hidden  past comments are hidden and no new comments are allowed additional resources online documentation for content comment settings ',0),
(50,'en','help_search',' creating a comment type goal create a new comment type see managing comments for information about comments and comment types who can create a comment type  users with the administer comment types and settings permission typically administrators can create comment types steps in the manage administrative menu navigate to structure   comment types  click add comment type  in the label field enter a name for the comment type which is how it will be listed in the administrative interface in the target entity type field select the entity type to be commented on see managing content structure for more about content entities and fields click save  the comment type will be created optionally if you have the core field ui module installed you can follow the steps in the related topics to add fields to the new comment type set up the editing form and configure the display  ',0),
(51,'en','help_search',' disabling comments goal turn off commenting for a particular entity see managing content structure for more about content entities and fields note that if you want to turn off commenting for all entities of an entity type or subtype you will need to edit the field settings for the comment field see configuring comments for more about configuring the comment field who can disable comments  you will need the administer comments and comment settings permission in order to disable commenting you will also need permission to edit the entity that the comments are on steps find the entity you want to disable comments for and edit it for example to turn off comments on a content item you could find it by navigating in the manage administrative menu to content  filtering to find the content item and clicking edit  under comment settings  select the desired comment setting  open  comments are allowed closed  past comments remain visible but no new comments are allowed hidden  past comments are hidden and no new comments are allowed save the entity  ',0),
(52,'en','help_search',' moderating comments goal decide which comments are shown on the website who can moderate comments  users with the administer comments and comment settings permission typically administrators can moderate comments you will also need the access the content overview page permission from the node module if it is installed to navigate to the comment management page steps in the manage administrative menu navigate to content   comments  a list of all comments is shown to unpublish comments select one or more comments by checking the boxes on the left side right side in righttoleft languages then select unpublish comment from the action select list and click apply to selected items  if you select the delete comment action you can instead delete the unwanted comments to change the content of a comment click edit from the dropdown button for a particular comment to publish comments that are not yet visible on the website navigate to the unapproved comments tab select one or more comments by checking the boxes on the left side right side in righttoleft languages then select publish comment from the action select list and click apply to selected items  additional resources online documentation for moderating comments ',0),
(53,'en','help_search',' managing comments what is a comment  a comment is a piece of content typically posted by a website visitor which provides discussion or commentary on other content like blog posts and news articles comments are a type of content entity and can have fields that store text html markup and other data comments are attached to other content entities via comment fields see managing content structure for more about content entities and fields what is a comment type  comments are divided into comment types  which are the entity subtypes for the comment entity type each comment type has its own fields and its own form and display settings each type can be used to comment on a single entity type you can set up different comment types for different commenting purposes on your web site for example you might set up a comment type for recipes that has fields how did it taste and did the instructions work and another comment type for blog entries that has only a generic comment body field what is moderation  moderation is a workflow where comments posted by some users on your site are verified before being published to prevent spam and other bad behavior the core software provides basic moderation functionality you can configure permissions so that new comments posted by some user roles start as unpublished until a user with a different role reviews and publishes them contributed modules provide additional moderation and spamreduction functionality such as requiring untrusted users pass a captcha test before submitting comments and letting community members flag comments as possible spam see managing user accounts and site visitors for more about users permissions and roles overview of managing comments the core comment module provides the following functionality posting comments creating comment types the core field ui module allows you to attach fields to comment types and attach comment reference fields to other entities so that people can comment on them configuring commenting moderating comments as discussed above see the related topics listed below for specific tasks  ',0),
(54,'en','help_search',' using contextual links goal use contextual links to access administrative tasks without navigating the administrative menu what are contextual links  contextual links give users with the use contextual links permission quick access to administrative tasks related to areas of nonadministrative pages for example if a page on your site displays a block the block would have a contextual link that would allow users with permission to configure the block if the block contains a menu or a view it would also have a contextual link for editing the menu links or the view clicking a contextual link takes you to the related administrative page directly without needing to navigate through the administrative menu system steps make sure that the core contextual links module is installed and that you have a role with the use contextual links permission optionally make sure that a toolbar module is installed either the core toolbar module or a contributed module replacement visit a nonadministrative page on your site such as the home page locate a block or another area on the page that you want to edit or configure make the contextual links button visible by hovering your mouse over that area in the page in most themes this button looks like a pencil and is placed in the upper right corner of the page area upper left for righttoleft languages and hovering will also temporarily outline the affected area alternatively click the contextual links toggle button on the right end of the toolbar left end for righttoleft languages which will make all contextual link buttons on the page visible until it is clicked again while the contextual links button for the area of interest is visible click the button to display the list of links for that area click a link in the list to visit the corresponding administrative page complete your administrative task and save your settings or cancel the action you should be returned to the page you started from  ',0),
(55,'en','help_search',' adding a field to an entity subtype goal add a field to an entity subtype see managing content structure for an overview of entity types and subtypes as well as an overview of field types steps navigate to the page for managing the entity subtype you want to add the field to for example to add a field to a content type in the manage administrative menu navigate to structure   content types  find the particular subtype that you want to add the field to and click manage fields  click add field  in add a new field  select the type of field you want to add see managing content structure for an overview of field types the label field should now be visible enter a label for the field which is used as the field label for both content editing and content display click save and continue  on the next screen enter a value for allowed number of values  you can limit the field to one value per entity item a set number of values or set it to have unlimited values click save field settings  on the next screen optionally edit the settings for the field which vary depending on what field type you are creating for all fields you can edit the label   help text  text to be displayed below the field on the content editing page and required field  to make it so a value must be entered in order to save the content when editing you can also configure a default value for the field click save settings  you should be returned to the manage fields page with your new field in the list  ',0),
(56,'en','help_search',' configuring field display for an entity subtype goal configure the formatters used to display the fields of an entity subtype their order in the display and the formatter settings see managing content structure for background information steps navigate to the page for managing the entity type you want to add the field to for example to add a field to a content type in the manage administrative menu navigate to structure   content types  find the particular subtype that you want to configure the display of and click manage display in the operations list use the drag arrows to order the fields in your preferred order drag any fields that you do not wish to see in the display to the disabled section in the label column select the position for each field label in the display or  hidden  to hide a label you can also choose  visually hidden if you want the label s text to appear in the html page so that screen readers and search engines can read it but it will not be visible in the format column select the formatter for displaying each field after selecting the desired formatters click the settings gear in each row to change the settings for the formatter when you are done making changes click save  test the display for your entity subtype by viewing an entity if needed return to these steps to further refine the display  ',0),
(57,'en','help_search',' configuring the edit form for an entity subtype goal configure the widgets used to edit the fields of an entity subtype their order on the form and the widget settings see managing content structure for background information steps navigate to the page for managing the entity type you want to add the field to for example to add a field to a content type in the manage administrative menu navigate to structure   content types  find the particular subtype that you want to configure the editing form for and click manage form display in the operations list use the drag arrows to order the fields in your preferred order drag any fields that you do not wish to see on the editing form to the disabled section in the widget column select the widget for editing each field after selecting the desired widgets click the settings gear in each row to change the settings for the widget when you are done making changes click save  test the editing form for your entity subtype by editing or creating an entity if needed return to these steps to further refine the form  ',0),
(58,'en','help_search',' adding a reference field to an entity subtype goal add an entity reference field to an entity subtype see managing content structure for more information on entities and reference fields steps navigate to the page for managing the entity subtype you want to add the field to for example to add a field to a content type in the manage administrative menu navigate to structure   content types  find the particular subtype that you want to add the field to and click manage fields  click add field  in add a new field  select the type of reference field you want to add the reference section of the select list shows the most common types of reference field choose other  if the entity type you want to reference is not listed the label field should now be visible enter a label for the field which is used as the field label for both content editing and content display click save and continue  on the next screen verify that the type of entity you want to reference is shown in type of item to reference  or select it if not enter a value for allowed number of values  you can limit the field to one value per entity item a set number of values or set it to have unlimited values click save field settings  on the next screen optionally edit the settings for label   help text  text to be displayed below the field on the content editing page and required field  to make it so a value must be entered in order to save the content when editing in the reference type section you will usually want to limit the entity subtypes that can be referenced for example if you are creating a content reference you can check one or two content type choices the choices will be easier for content editors to scan if you also choose a sort value normally the entity title or label field click save settings  you should be returned to the manage fields page with your new field in the list  ',0),
(59,'en','help_search',' adding an image style goal add a new image style which can be used to process and display images see managing media for an overview of image styles steps in the manage administrative menu navigate to configuration   media  image styles click add image style  enter a descriptive image style name  and click create new style  under effect  choose an effect to apply and click add  configure the effect on the next page most effects require some additional configuration after they are added for example for the crop effect enter the width and height to crop the image to and choose the anchor point click add effect  repeat the previous two steps until all of the effects have been added drag to change the order of the effects then click save to save the new order the image style can now be used to format a field containing an image in your layouts or traditional field displays it can also be used as part of a responsive image style see related topics below for more information  ',0),
(60,'en','help_search',' configure menu settings for a content type goal for an existing content type configure the available menus that will be shown as options on content editing screens links to content items of this type can be added to these menus during editing steps in the manage administrative menu navigate to structure   content types  locate the content type you want to configure and click edit in the operations list under menu settings  check the menus that you want to be available when editing a content item of this type optionally select the default parent item  to put links to content items under a default location in the menu structure click save   ',0),
(61,'en','help_search',' adding a link to a menu goal add a link to a menu note that you can also add a link to a menu from the content edit page if menu settings have been configured for the content type steps in the manage administration menu navigate to structure  menus locate the desired menu and click add link in the operations list enter the menu link title to be displayed enter the link  one of the following an internal path such as  node add a full external url start typing the title of a content item and select it when the full title comes up  nolink  to display the menu link title as plain text without a link  front  to link to the front page of your site make sure that enabled is checked if not the menu link will not be displayed optionally enter a description  which will be displayed when a user hovers over the link optionally check show as expanded to automatically show the children of this link if any when this link is shown optionally select the parent link  if this menu link should be a child of another menu link click save  you will be returned to the add link page to add another link in the manage administration menu navigate to structure  menus locate the menu you just added a link to and click edit in the operations list verify that the order of links is correct if it is not drag menu links until the order is correct and click save   ',0),
(62,'en','help_search',' creating a menu goal create a new menu steps in the manage administration menu navigate structure  menus click add menu  enter the title for the menu which is used as the default block title if the menu is displayed as a block if desired also edit the machine name of the menu which is by default derived from the title enter an administrative summary which is displayed on the menus page if your site has more than one language choose the language for the menu click save  you will be on the menu editing page ready to add links to the menu if the core custom menu links module is installed see related topics for further tasks  ',0),
(63,'en','help_search',' reordering and disabling menu links goal disable menu links or change the order and hierarchy of menu links steps in the manage administration menu navigate to structure  menus click edit menu for the menu that you want to edit drag menu links into a new order or check uncheck enabled to enable or disable menu links click save to save your changes  ',0),
(64,'en','help_search',' creating a content item goal create and publish a content item see managing content for more about content types and content items who can create content  users with the access the content overview page permission can visit the content page as described in this topic each content type has its own create permissions for example to create content of type article a user would need the article create new content permission in addition users with the bypass content access control or administer content permission can create content items of all types some contributed modules change the permission structure for creating content steps in the manage administrative menu navigate to content  click add content  if there is more than one content type defined on your site that you have permission to create click the name of the type of content you want to create on the content edit form enter the title of your content which will show as the page title when the content item is displayed on a page and also as the label for the content item in administration screens fill in the other fields shown on the edit form for this specific content type leave the published field checked to publish the content immediately or uncheck it to make it unpublished unpublished content is generally not shown to nonadministrative site users optionally click preview to preview the content click save  you will see the content displayed on a page additional resources basic page management drupal user guide  creating a content item drupal user guide  ',0),
(65,'en','help_search',' creating a content type goal create a new content type see managing content for more about content types who can create a content type  users with the administer content types permission typically administrators can create new content types steps in the manage administrative menu navigate to structure   content types  click add content type in the name field enter a name for the content type which is how it will be listed in the administrative interface optionally enter a description for the content type you may also want to adjust some of the settings in the vertical tabs section of the edit page click save and manage fields  your content type will be created and assuming you have the core field ui module installed you will be taken to the manage fields page for the content type if you do not have the core field ui module installed the button will say save instead if you have the core field ui module installed follow the steps in the related topics to add fields to the new content type set up the editing form and configure the display additional resources adding a content type drupal user guide  setting up content structure drupal user guide  ',0),
(66,'en','help_search',' editing a content item goal find a content item and edit it or update a group of content items in bulk see managing content for more about content types and content items who can find and edit content  users with the access the content overview page permission can use the content page to find content each content type has its own edit permissions for example to edit content of type article a user would need the article edit own content permission to edit an article they created or the article edit any content permission to edit an article someone else created in addition users with the bypass content access control or administer content permission can edit content items of all types some contributed modules change the permission structure for editing content steps in the manage administrative menu navigate to content  optionally use filters to reduce the list of content items shown  title  key word s from the title content type published status language if you enter or select filter values click filter to apply the filters optionally sort the list by clicking a column header click again to reverse the order to edit the title or other field values for one content item click edit in the row of the content item update the values and click save  a few types of edits can be done in bulk to multiple content items for example to publish several unpublished content items check the boxes in the left column right column in righttoleft languages to select the desired content items for action  select the publish content action click apply to selected items to make the change the other actions under action work in a similar manner additional resources basic page management drupal user guide  editing a content item drupal user guide  ',0),
(67,'en','help_search',' managing content what is a content item  a content item is a type of content entity for pagelevel content which can have fields that store text html markup images attached files and other data see managing content structure for more about content entities and fields what is a content type  content items are divided into content types  which are the entity subtypes for the content item entity type each content type has its own fields and display settings for example you might set up content types for pages articles recipes events and blog entries on your web site overview of managing content the core node module allows you to define content types and add and edit content items the core field ui module allows you to attach fields to each content type and manage the edit form and display for each content type see the related topics listed below for specific tasks many other core and contributed modules and installation profiles provide predefined content types modify the permission structure for content items and provide other functionality  ',0),
(68,'en','help_search',' creating a url alias for a content item goal give a content item page a human or seofriendly url alias you can follow similar steps to create an alias for a taxonomy term page see configuring aliases for urls for more about aliases who can create url aliases  users with the create and edit url aliases permission can create aliases to follow the steps in this topic you will also need permission to edit the content item steps locate and open the content edit form for the content item or create a new content item see related topics on creating and editing content under url alias on the edit form enter the desired alias for example aboutus make sure the alias starts with a character click save  verify that the page can be visited with the new alias for example https examplecom aboutus  additional resources creating a content item drupal user guide  ',0),
(69,'en','help_search',' editing a url alias goal change an existing url alias to correct the path or the alias value see configuring aliases for urls for more about aliases who can manage url aliases  users with the administer url aliases permission can edit aliases steps in the manage administration menu navigate to configuration   search and metadata   url aliases  a list of all the site s aliases will appear click edit in the dropdown button for the alias that you would like to change make the required changes and click save  you will be returned to the url alias list page note that you can also add new aliases from this page for any path on your site  ',0),
(70,'en','help_search',' configuring aliases for urls what is a url  url is the abbreviation for uniform resource locator which is the page s address on the web it is the name by which a browser identifies a page to display in the example visit us at examplecom   https examplecom would be the url for the home page of your website users use urls to locate content on the web what is a path  a path is the unique last part of the url for a specific function or piece of content for example for a page whose full url is https examplecom node 7  the path is node 7  here are some examples of paths you might find in your site node 7 path to a particular content item taxonomy term 6 path to a taxonomy term page user 3 path to a user profile page what is an alias  the core software allows you to provide more understandable urls for pages on your site which are called aliases  for example if you have an about us page with the path node 7  you can set up an alias of about so that your visitors will see it as https wwwexamplecom about  overview of configuring paths aliases and urls the core path module provides the url aliasing functionality the contributed pathauto module allows you to configure automaticallygenerated url aliases for content items and other pages see the related topics listed below for specific tasks additional resources concept paths aliases and urls drupal user guide  ',0),
(71,'en','help_search',' creating and using shortcut administrative links goal create view and use a set of shortcuts to access administrative pages what are shortcuts  shortcuts are quick links to administrative pages they are managed by the core shortcut module a site can have one or more shortcut sets  which can be shared by one or more users by default there is only one set shared by all users each set contains a limited number of shortcuts users need use shortcuts permission to view shortcuts  edit current shortcut set permission to add delete or edit the shortcuts in the set assigned to them and select any shortcut set permission to select a different shortcut set when editing their user profile there is also an administer shortcuts permission which allows an administrator to do any of these actions as well as select shortcut sets for other users steps make sure that the core shortcut module is installed and that you have a role with edit current shortcut set or administer shortcuts permission also make sure that a toolbar module is installed either the core toolbar module or a contributed module replacement navigate to an administrative page that you want in your shortcut list click the shortcut link to add the page to your shortcut list in the core claro administrative theme the link looks like a star and is displayed next to the page title however if the page is already in your shortcut set clicking the shortcut link will remove it from your shortcut set repeat until all the desired links have been added to your shortcut set click shortcuts in the toolbar to display your shortcuts and verify that the list is complete optionally click edit shortcuts at the right end of the shortcut list left end in righttoleft languages to remove links or change their order click any link in the shortcut bar to go directly to the administrative page  ',0),
(72,'en','help_search',' configuring taxonomy goal create a taxonomy vocabulary and add a reference field for that vocabulary to a content entity see managing taxonomy for information about taxonomy and managing content structure for more on content entities who can configure a taxonomy vocabulary  users with the administer vocabularies and terms permission can configure a vocabulary to add a field in the administrative interface the core field ui module must be installed and you will also need the administer fields permission for the entity you are adding the field to steps in the manage administrative menu navigate to structure   taxonomy  click add vocabulary  in the name field enter a name for the vocabulary for example ingredients which is how it will be shown in the administrative interface optionally add a description click save  your vocabulary will be created and you will see the page that lists all the terms in this vocabulary optionally click add term to add a term to the new vocabulary in the name field enter the term name for example butter click save  you will receive a confirmation about the term you created you may optionally continue to add more terms if you have the field ui module installed follow the instructions on the related adding a reference field to an entity subtype topic to add a taxonomy reference field to the entity type of your choice the settings page will allow you to choose the vocabulary that you created as the vocabulary to reference you may also want to configure the display and form display of the new field see related topics  additional resources setting up a taxonomy drupal user guide  ',0),
(73,'en','help_search',' managing taxonomy what is taxonomy  taxonomy is used to classify website content one common example of taxonomy is the tags used to classify or categorize posts in a blog website a cooking website could use an ingredients taxonomy to classify recipes individual taxonomy items are known as terms  the blog tags or recipe ingredients in these examples and a set of terms is known as a vocabulary  the set of all blog post tags or the set of all recipe ingredients in these examples technically taxonomy terms are an entity type and the entity subtypes are the vocabularies see managing content structure for more on content entities like other entities taxonomy terms can have fields attached for instance you could set up an image field to contain an icon for each term an individual vocabulary can organize its terms in a hierarchy or it could be flat for example blog tags normally have a flat structure while a recipe ingredients vocabulary could be hierarchical for example tomatoes could be a subterm of vegetables and under tomatoes you could have green and red tomatoes taxonomy terms are normally attached as reference fields to other content entities which is how you can use them to classify content when you set up a taxonomy reference field you can let users enter terms in two ways free tagging new terms can be created right on the content editing form fixed list of terms the list of terms is curated and managed outside the content editing form and users can only select from the existing list when editing content taxonomy reference fields can be added to any entity such as user accounts content blocks or regular content items if you use them to classify regular content items your site will automatically be set up with taxonomy listing pages for each term each of these pages lists all of the content items that are classified with that term overview of managing taxonomy the core taxonomy module allows you to create and edit taxonomy vocabularies and taxonomy terms the core field ui module provides a user interface for adding fields to entities including the taxonomy reference field and configuring field editing and display see the related topics listed below for specific tasks additional resources concept taxonomy drupal user guide  ',0),
(74,'en','help_search',' managing content listings views  what is a view  a view is a listing of items on your site for example a block showing the most recent comments a page listing news items or a list of registered users the listings can be formatted in a table grid list calendar rss feed and other formats some output formats may require you to install additional contributed modules  what are the components of a view  when you first create a view you will specify what type of base data is being displayed in the view which cannot be changed after choosing a base data type you can edit the following components which allow you to specify which data to output in what order and in what format  displays  whether the output goes to a page block feed etc a single view can have multiple displays each with different settings format  the output style for each display such as content item grid table or html list fields  if the format allows the particular fields to display filter criteria  criteria to limit the data to output such as whether the content is published the type of content etc filters can be exposed to let users choose how to filter the data sort criteria  how to order the data sorting can also be exposed to users page settings   block settings  etc settings specific to the display type such as the url for a page display most display types support an access setting where you can choose a permission or role that a user must have in order to see the view header and footer  content to display at the top or bottom of the view display no results behavior  what to do if the filter criteria result in having no data to display pager  how many items to display and how to paginate if there are additional items to display advanced   contextual filters  like regular filters except the criteria come from the context  such as the current date page the view is displayed on etc advanced   relationships  additional data to pull in and display related in some way to the base data of the view such as data about the user who created the content item  advanced   exposed form  if you have exposed filters or sorts how to display the form to the user what are bulk operations  views using a table display format can include a bulk operations form which allows users with sufficient permission to select one or more items from the view and apply an administrative action to them the bulk actions available are specific to the base data type of the view for example a view of content items could support bulk publishing and unpublishing actions if you have the core actions ui module installed see the related topic configuring actions for more about actions managing views overview the core views module handles the display of views and the core views ui module allows you to create edit and delete views in the administrative interface see the related topics listed below for specific tasks if the views ui module is installed  additional resources creating listings with views drupal user guide  ',0),
(75,'en','help_search',' adding a new display to an existing view goal add a new display to an existing view this will allow you to display similar data to an existing view using similar settings in a new block page feed etc steps if you are not already editing your view in the manage administrative menu navigate to structure   views  find the view you want to edit and click its edit link under displays  click add  in the popup list click the link for the type of display you want to add the most common types are page and block  the new display will be added to your view and you will be editing that display optionally click the link next to display name and enter a new name to be shown for this display in the administrative interface follow the steps in editing an existing view display to edit the other settings for the display  ',0),
(76,'en','help_search',' adding a bulk operations form to a view goal add one or more existing actions as bulk operations to an existing tablestyle view if you have the core actions ui module installed see the related topic configuring actions for more information about actions who can edit views  the core views ui module will need to be installed and you will need administer views permission in order to edit a view steps in the manage administrative menu navigate to structure   views  a list of all views is shown find the view that you would like to edit and click edit from the dropdown button note that bulk operations work best in a view with a page display and a table format if there is not already an operations bulk form in the fields list for the view click add in the fields section to add it the exact name of the bulk form field will vary and may contain keywords like bulk update form element or operations not to be confused with operations links  which are applied to each item in a row if the bulk operations field already exists click the field name to edit its settings check the action s you want to make available in the selected actions list and click apply all displays   verify that the access settings for the view are at least as restrictive as the permissions necessary to perform the bulk operations people with permission to see the view but who don t have permission to do the bulk operations will experience problems click save  the action s will be available as bulk operations in the view  ',0),
(77,'en','help_search',' creating a new view goal create a new view to list content or other items on your site steps in the manage administrative menu navigate to structure   views  click add view  in the view name field enter a name for the view which is how it will be listed in the administrative interface in view settings   show  select the base data type to display in your view this cannot be changed later optionally select or enter filtering sorting and page block display settings these can be added or changed later click save and edit  your view will be created edit it following the steps in the related topics below  ',0),
(78,'en','help_search',' editing an existing view display goal edit an existing view display to modify what data is displayed or how it is displayed steps if you are not already editing your view in the manage administrative menu navigate to structure   views  find the view you want to edit and click its edit link under displays  click the display you want to edit find the section whose settings you want to change such as format or filter criteria  see managing content listings views for more information for sections containing lists such as fields and filter criteria  to modify or delete an existing item click the name of the item to add a new item click add in the dropdown list to change the order of items click rearrange in the dropdown list for sections containing individual settings such as title and format  there are often two links for each setting the first link shows the current value click that link to change the value if there is a second link called settings  click that link to change the settings details for example if your format is currently shown as unformatted list  click unformatted list to switch to using a grid or table format click settings next to your format type to change the settings for your chosen format when you have finished changing all the settings verify that the display is correct by clicking update preview  return to editing settings if necessary when you have verified the display click save  alternatively if you have made mistakes and want to discard your changes click cancel  additional resources creating listings with views drupal user guide  ',0);
